  [],\n\t\"revision_timestamp\": \"2015-12-21T00:02:51.921274\",\n\t\"name\": \"necropsy-data\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains information on Hawaiian
  monk seal gross necropsy (in some cases only field notes or minimal information)
  and histopathology results beginning in 1964. Data includes information on all recovered
  Hawaiian monk seal carcasses that were necropsied. Information derived from pathology
  reports is included when tissues were reviewed by pathologists.   Necropsy tissues
  are collected  by  PSD personnel and cooperating scientists as part of the ongoing
  health and disease assessment. The tissues are reviewed by collaborating pathologists.
  All original paper reports are housed at PIFSC Kewalo Research Facility and most
  are available electronically. Data is available in an excel spreadsheet.\",\n\t\"license_title\":
